const Actions = {
    addTimer(value) {
      return {
        type: 'ADDTIMER',
        value,
      }
    },
    fixtimer(value) {
      return {
        type: 'FIXtimer',
        value,
      }
    },
    updtimer(value) {
      return {
        type: 'UPDtimer',
        value,
      }
    },
    deltimer(value) {
      return {
        type: 'DELtimer',
        value,
      }
    },
    fetchtimer(value) {
      return {
        type: 'FETCHtimer',
        value,
      }
    },
  }

  export default Actions
